import { Link } from "react-router-dom";
import '../Styles/Navbar.css'

function Navbar() {
  return(
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/flies">Flies</Link>
          </li>
          <li>
            <Link to="/bugs">Bugs</Link>
          </li>
          <li>
            <Link to="/streams">Streams</Link>
          </li>
        </ul>
      </nav>
    );
};


export default Navbar;
